import styled from 'styled-components';

export const Container = styled.div`
	margin: auto;
	width: 800px;
	text-align: center;
	position: relative;
	top: 10px;
`;

export const BookingPackage = styled.div`
	display flex;
	justify-content: space-between;
	align-items: center;
	background: #f1f1f1;
	padding: 10px;
	border-radius: 8px;
	box-shadow: 10px 10px 4px #eaeaea;
`;
export const BookingDetail = styled.div`
	background: #f1f1f1;
	padding: 10px;
	border-radius: 8px;
	box-shadow: 10px 10px 4px #eaeaea;


`
